// src/components/ImageCard.js
import React from "react";
import "../styles/ImageCard.css";

const ImageCard = ({ image }) => {
  return (
    <div className="image-card">
      <img src={image.url} alt={image.title} />
      <h3>{image.title}</h3>
    </div>
  );
};

export default ImageCard;
